import React from 'react';
import './Navbar.css';
import logo from '../ImagesLogo/logo1.jpeg';
import { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLine } from '@fortawesome/free-brands-svg-icons';
import { faArrowAltCircleDown } from '@fortawesome/free-regular-svg-icons';

function Navbar() {

  const [menu,setmenu]=useState('home')
  return (
    <div>
      <div className='nav-bar'>
        <img src={logo} alt='' />
        <ul className='nav-menu'>
          <li><p onClick={()=>setmenu('home')}>Home</p>{menu==='home'?<FontAwesomeIcon icon={faArrowAltCircleDown}/>:<></>}</li>
          <li><p onClick={()=>setmenu('about')}>About Me</p>{menu==='about'?<FontAwesomeIcon icon={faLine}/>:<></>}</li>
          <li><p  onClick={()=>setmenu('skills')} >Skills</p>{menu==='skills'?<FontAwesomeIcon icon={faLine}/>:<></>}</li>
          <li><p  onClick={()=>setmenu('projects')}>Projects</p>{menu==='projects'?<FontAwesomeIcon icon={faLine}/>:<></>}</li>
          <li><p  onClick={()=>setmenu('contact')}>Contact</p>{menu==='contact'?<FontAwesomeIcon icon={faLine}/>:<></>}</li>
        </ul>
        <div className="nav-connect">Connect With Me</div>
      </div>

    </div>
  )
}

export default Navbar;
